column8:
　アロモア［aromore］用部品『ウッド用ノズルキャップ』

<BR>
(ご注意）<BR>
<b>エッセンシャルオイルディフューザーaromore（アロモア）ウッド専用　ノズルキャップ<br></b>
<b><font style="color:red;">シルバー、パープルでは使用できませんので、ご注意ください。</font></b>
<BR>
<BR>
<BR>
付属のオイルを吸い上げるチューブは30mlに合わせた長さになっています。<BR>
5ml・10ml・20mlボトルでお使いの際は、切って長さを調整して下さい。<BR>
また、一度短く切ってしまうと30mlボトルでは使用できなくなりますのでご注意下さい。 <BR>
<BR>
<BR>
<FONT size="2" color="cccccc">アロマ エッセンシャルオイル 精油 アロマオイル リラクゼーション 父の日アロマランプディフューザー/アロマ/アロマオイル/ディフューザー/アロマディフューザー/精油/エッセンシャルオイル/ブレンド T05P20May16</FONT>

